import React from 'react'
import { FaMapMarkerAlt } from 'react-icons/fa'

import { DropdownComponent } from '../dropdown'
import { FormInput, FormInputContainer, FormInputLabel } from './styles'

export const InputFrom: React.FC<{
  type: string
  name: string
  label: string
  icon: any
}> = ({ type, name, label, icon }) => {
  return (
    <FormInputContainer>
      <FormInput type={type} name={name} id={name} />
      <FormInputLabel>{label}</FormInputLabel>
      {icon}

      <DropdownComponent
        cities={[
          ['test 1', 0, 1],
          ['test 2', 0, 1],
        ]}
      />
    </FormInputContainer>
  )
}
